const inputEvent = (event) =>{
  let newT = event.target.value;
  uptext(newT);
}

  return (
    <>
    <div>
      <h1> Hello {FullName} </h1>
      <input type="text"  placeholder='enter your name'  onChange={inputEvent} value={text}/>
      <button onClick={OnSubmit}> Click Me </button>
    </div>
    </>
  );
}

